import BabyProducts from './Categories/BabyProducts';
import Fashion from './Categories/Fashion';
import HealthBeauty from './Categories/HealthBeauty';
import Supermarket from './Categories/Supermarket'
import PhoneTablets from './Categories/PhoneTablets'

const MainSection = () => {
    return (
        <div className='main-sec'>
            <Supermarket />
            <Fashion />
            <HealthBeauty />
            <BabyProducts />
            <PhoneTablets />

        </div>
    )
}
export default MainSection;
